/**
 * @param {string} s
 * @return {string}
 */
var removeStars = function (s) {
    if (s.indexOf("*") === -1) {
        return s
    }
    const stack = []
    s.split("").map(element => {
        if (element === "*") {
            stack.pop()
        } else {
            stack.push(element)
        }
    })
    return stack.join("")
};

